  let
    create_order(data) = begin
      Qx, x = QQ[:x]
      K, = number_field(Qx(data[1]))
      aa = K(data[2]); bb = K(data[3]); B = [([K(x) for x in y]) for y in data[4]]; A = quaternion_algebra(K, aa, bb)
      O = order(A, sub(pseudo_hnf(pseudo_matrix(matrix(B)), :lowerleft), length(data[4])-3:length(data[4]), 1:4));
      return O
    end
    for i in 1:10
      j = rand(1:length(dataall))
      if j == 375
        continue # too large
      end
      O = create_order(dataall[j][1])
      @test length(Hecke.right_class_set(O)) == dataall[j][2][1]
      # locally free class group only works for orders over Z so far
      AA, AAtoA  = restrict_scalars(algebra(O), QQ);
      OO = Hecke.order(AA, preimage.(AAtoA, elem_in_algebra.(absolute_basis(O))))
      @test order(locally_free_class_group(OO)) == dataall[j][2][2]
    end
  end
